                        if ($slider.length)
                        {
                            if ($slider.data("slider-pagination-element"))
                            {
                                tag = $slider.data("slider-pagination-element");
                            }
                        }
                        if (!name) {
                            name = "";
                        }
                        else {
                            name = "<div class='swiper-pagination-name'>" + name + "</div>";
                        }
                        if (!summary) {
                            summary = "";
                        }
                        else {
                            summary = "<div class='swiper-pagination-summary'>" + summary + "</div>";
                        }
