function section_bg_video_init() {

    $(window).on('resize load section-video-resize', function(){

        $('.section__bg video, .video-player video').each(function(){
            var $video = $(this);
            var vid_w_orig = $video.attr('width');
            var vid_h_orig = $video.attr('height');

            var container_w = $video.parent().width();
            var container_h = $video.parent().height();

            var scale_w = container_w / vid_w_orig;
            var scale_h = container_h / vid_h_orig;
            var scale = scale_w > scale_h ? scale_w : scale_h;

            $video.width(scale * vid_w_orig);
            $video.height(scale * vid_h_orig);
            $video.addClass('auto-resized');
        });

    });

    $(window).trigger('section-video-resize');


    $('.js-video-bg').each(function(){
        $(this)[0].onplay = $(this)[0].onpause = function() {
            var $control = $($(this).data('video-control'));
            $control.toggleClass("video-paused", this.paused);
            $control.toggleClass("video-playing", !this.paused);
        };
    });

    $(document).on("click", ".js-video-bg", function (e) {
        if (this.paused) {
            this.play();
        } else {
            this.pause();
        }
    });

    $(document).on("click", ".js-video-play-pause", function (e) {
        e.preventDefault();
        var video = $($(this).data('video-target'))[0];
        if (video.paused) {
            video.play();
        } else {
            video.pause();
        }
        $(this).toggleClass("video-paused", video.paused);
        $(this).toggleClass("video-playing", !video.paused);
    });
}

function through_viewer_init() {

    through_viewer_fix_100vh_init();

    if (!$('.js-through-viewer').length) {
        return;
    }

    var gradient = "radial-gradient(circle closest-corner at {x}px {y}px , rgba(8,20,26,{o1}) 0%, rgba(8,20,26,{o2}) 50%)";
    //var gradient = "radial-gradient(circle closest-corner at {x}px {y}px , rgba(8,20,26,{o1}) 0%, rgba(8,20,26,0) 30%, rgba(8,20,26,{o2}) 40%)";

    $(document).imagesLoaded(function () {
        $('.js-through-viewer').each(function(){
            var $o = $(this);
            var w = $(this).width();
            var x1 = -1*w/3;
            var x2 = w + w/3;
            var y = $(this).height()/2;
            window.throughViewerGradientAnimation = $({x: x1, y: y}).stop(false, true).animate({x: x2, y: y}, {
                step: function(value, tween) {
                    if (!$o.data('outofbox')) {
                        $o.css("background-image", gradient.replace('{x}', tween.elem.x).replace('{y}', tween.elem.y).replace('{o1}', 0).replace('{o2}', 0.9));
                    }
                },
                complete: function(){},
                duration: 3000,
            });
        });
    });

    $(document).on('mousemove touchstart', '.js-through-viewer', function (e) {
        if (e.type == 'mousemove' && !Modernizr.touchevents || e.type == 'touchstart' && Modernizr.touchevents) {
            var x = e.clientX;
            var y = e.clientY;
            if (typeof e.clientX === 'undefined') {
                x = e.changedTouches[0].clientX;
                y = e.changedTouches[0].clientY;
            }
            x = x - this.getBoundingClientRect().left;
            y = y - this.getBoundingClientRect().top;
            var $o = $(this);
            var coords = {x: $o.width()/2, y: -1*$o.width()/2};
            if ($o.data('coords')) {
                coords = $o.data('coords');
            }
            $o.css("background", "none");
            if (window.throughViewerGradientAnimation) {
                window.throughViewerGradientAnimation.stop();
                coords = {x: window.throughViewerGradientAnimation[0].x, y: window.throughViewerGradientAnimation[0].y}
            }
            if ((e.type == 'touchstart' && Modernizr.touchevents) || window.throughViewerGradientAnimation) {
                $(coords).stop(false, true).animate({x: x, y: y}, {
                    step: function(value, tween) {
                        if (!$o.data('outofbox')) {
                            $o.css("background-image", gradient.replace('{x}', tween.elem.x).replace('{y}', tween.elem.y).replace('{o1}', 0).replace('{o2}', 0.9));
                        }
                    },
                    duration: 200
                    //easing: 'linear'
                });
            }
            else {
                $(coords).stop(true, true);
                $o.css("background-image", gradient.replace('{x}', x).replace('{y}', y).replace('{o1}', 0).replace('{o2}', 0.9));
            }
            window.throughViewerGradientAnimation = null;
            $(this).data('coords', {x: x, y: y});
            $o.data('outofbox', false);
        }
    });

    $(document).on('mouseleave', '.js-through-viewer', function (e) {
        if (!Modernizr.touchevents) {
            var $o = $(this);
            var coords = {x: 0, y: 0};
            $o.data('outofbox', true);
            if ($o.data('coords')) {
                coords = $o.data('coords');
            }
            var coords_start = $.extend(true, {}, coords, {o1: 0});
            var coords_end = $.extend(true, {}, coords, {o1: 0.9}); // {x: $o.width()/2, y: $o.height()/2}

            $(coords_start).stop(true, true).animate(coords_end, {
                step: function(value, tween) {
                    if (tween.prop == 'o1') {
                        $o.css("background-image", gradient.replace('{x}', tween.elem.x).replace('{y}', tween.elem.y).replace('{o1}', tween.elem.o1).replace('{o2}', 0.9));
                    }
                },
                duration: 200
            });
        }
    });

    window.blockThroughViewerScroll = false;
    window.throughViewerScrolled = false;
    window.throughViewerDeltaY = 0;

    document.addEventListener('touchstart', function(e) {
        if ($(e.target).closest('.js-through-viewer').length == 1)
        {
            blockThroughViewerScroll = true;
            window.throughViewerDeltaY = e.changedTouches[0].clientY;
        }
    }, {passive: false});

    document.addEventListener('touchend', function(e) {
        var delta =  window.throughViewerDeltaY - e.changedTouches[0].clientY;
        var $o = $('body');
        if (blockThroughViewerScroll)
        {
            through_viewer_scroll(e, $o, delta);
        }
        blockThroughViewerScroll = false;
        window.blockThroughViewerDelta = 0;
    }, {passive: false});

    document.addEventListener('touchmove', function(e) {
        var delta =  window.throughViewerDeltaY - e.changedTouches[0].clientY;
        var $o = $('body');
        if (blockThroughViewerScroll)
        {
            through_viewer_scroll(e, $o, delta, true);
        }
    }, {passive: false});


    $('body').on('mousewheel', function(e) {
        if ($(e.target).closest('.js-through-viewer').length) {
            var delta = -1*e.deltaY*e.deltaFactor;
            var $o = $(this);
            through_viewer_scroll(e, $o, delta);
        }
    });

    $(window).on('scroll', function(e) {
        window.throughViewerScrolled = $(window).scrollTop() > 0;
    });

    var ie = detectIE();
    if (ie > 11 || !ie) {
    }
    through_viewer_cursor_init()

}

