function through_viewer_scroll(e, $o, delta, restore) {
    var h = window.innerHeight;
    var restore_value = $o.data('deltaY');
    if (!$o.data('deltaY')) {
        $o.data('deltaY', 0);
    }
    if ($(window).scrollTop() == 0 || $(window).scrollTop() + delta <= 0) {
        if ($o.data('deltaY') <= h) {
            if ($(window).scrollTop() == 0) {
                e.preventDefault();
            }
        }
    }
    through_viewer_scroll_delay(function(){
        if ($(window).scrollTop() == 0 || $(window).scrollTop() + delta <= 0) {
            var y = $o.data('deltaY') + delta;
            if (y < 0) y = 0;
            $o.data('deltaY', y);
            var opacity = 1 - $o.data('deltaY')/h;
            if ($o.data('deltaY') <= h) {
                if ($(window).scrollTop() == 0) {
                    e.preventDefault();
                }
                $('.js-through-viewer').css('opacity', opacity);
            }
            else {
                $('.js-through-viewer').css('opacity', 0);
                if ($(window).scrollTop() == 0 && window.throughViewerScrolled) {
                    $o.data('deltaY', 0);
                }
            }
        }
        if (restore) {
            $o.data('deltaY', restore_value);
        }
    }, 50);
}

